import Logo from "./logo.png";
import "./App.css";
import styled from "styled-components";
import { ObjectDetector } from "./components/objectDetector";

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  // background-color: #1d2475;
  background-color: #3f3d42;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  color: #fff;
`;

function App() {
  return (
    <AppContainer>
      <div style={{ fontSize: 60, marginBottom: 30, }}> 텐서플로우를 활용한 객체인식</div>
      <ObjectDetector />
      <span style={{fontSize:24,fontWeight:600, padding:30}}>ICT융합캡스톤디자인 이승진</span>
      <div className="row"> <img src={Logo} style={{ width: 150, marginTop: 100 }} />
        {/* <img src='http://ict.hanyang.ac.kr/img/logo_ict.gif' /> */}

      </div>
    </AppContainer>
  );
}

export default App;
